import React from 'react'

interface IProps{

}

interface IState {
Count:number
}
class Props extends React.Component<IProps,IState>
{
    constructor(props:IProps)
    {
        super(props)
            this.state={
                Count:1
                
            }
        }
        
 update=()=>{
     this.setState(
         {
             Count:+1
         }
     )
 }
    

render()
{
    return(
        <React.Fragment>
           <div>
            <button onClick={this.update} >
                update
                
            </button>
            </div>
            <h3 >{this.state}1</h3>
        </React.Fragment>
    )
}

}
export default Props;
